INSERT INTO `community` VALUES (_binary '\0','2023-07-11 02:09:39.000000',1,3,'베란다에서 상추를 키우고 있어요. 햇빛이 부족할 땐 어떻게 해야 할까요? 조언 부탁드립니다!','베란다에서 상추 키우기'),(_binary '\0','2023-07-15 09:23:39.000000',2,11,'도시텃밭을 시작하려고 합니다. 필수로 필요한 도구가 무엇인지 추천해주세요.','도시텃밭에 필요한 도구'),(_binary '\0','2024-04-24 05:43:20.000000',3,10,'처음 심어 본 고구마, 언제 수확하면 좋을까요? 색이 많이 변했는데 괜찮을까요?','고구마 수확 시기 궁금해요'),(_binary '\0','2023-07-30 22:18:26.000000',4,10,'상추를 키우고 있는데 성장이 느려요. 햇빛과 물은 충분한데, 원인이 뭘까요?','상추가 자라지 않아요'),(_binary '\0','2024-07-12 05:47:39.000000',5,7,'요즘 벌레 때문에 작물이 피해를 입고 있어요. 친환경적인 방제법 추천해주실 분 계신가요?','해충 방제법 추천해요'),(_binary '\0','2024-05-28 15:12:40.000000',6,8,'옥상에서 텃밭을 만들어 보려고 하는데 작물 선정에 고민이 많아요. 추천 작물 있을까요?','옥상 텃밭, 가능한가요?'),(_binary '\0','2024-07-09 18:39:56.000000',7,2,'김장을 위해 배추를 키우고 있습니다. 병해충 예방을 어떻게 해야 할까요?','김장용 배추 키우기'),(_binary '\0','2023-05-19 19:41:48.000000',8,3,'드디어 주말농장에서 처음으로 감자를 수확했습니다! 감자 보관법을 알고 싶어요.','주말농장에서의 첫 수확'),(_binary '\0','2024-04-01 18:12:50.000000',9,13,'어떤 비료가 좋을지 고민 중입니다. 작물의 영양을 골고루 줄 수 있는 비료 추천해주세요.','텃밭 비료 추천 부탁드려요'),(_binary '\0','2024-08-01 15:38:54.000000',10,4,'겨울에 허브가 잘 자라지 않아요. 실내에서 키우는 관리법이 궁금해요!','겨울철 허브 관리 팁'),(_binary '\0','2023-01-22 21:02:46.000000',11,7,'오늘 드디어 주말농장을 처음 방문했어요. 작은 밭에 심어진 작물들이 너무 예쁘네요! 벌써 다음 주말이 기대됩니다.','주말농장 첫 방문기'),(_binary '\0','2023-05-01 08:01:17.000000',12,1,'요즘 베란다에 키우는 허브들이 잘 자라네요. 특히 바질 향이 너무 좋아서 요리에 자주 사용하게 돼요.','베란다 텃밭에서 자라는 허브'),(_binary '\0','2024-08-29 03:08:44.000000',13,13,'지난주에 심었던 토마토가 벌써 조금 자랐어요. 잎이 커지고 줄기도 더 단단해졌네요. 물 주는 재미가 있어요!','처음 심어본 토마토의 변화'),(_binary '\0','2023-07-19 06:45:12.000000',14,13,'아침 일찍 텃밭에 나가보니 상추가 싱그럽게 자라있었어요. 이른 아침 공기가 정말 상쾌하네요.','텃밭에서의 아침 풍경'),(_binary '\0','2024-01-17 11:50:14.000000',15,13,'새벽에 본 옥수수 잎에 맺힌 이슬이 너무 예뻐서 사진으로 남겼어요. 농사짓는 즐거움이 이런 거겠죠?','옥수수 잎에 이슬 맺힌 모습'),(_binary '\0','2023-04-06 18:55:46.000000',16,12,'오늘은 아이와 함께 상추를 수확했어요. 작은 손으로 상추를 하나하나 따는 모습이 정말 사랑스럽네요.','아이와 함께한 수확의 즐거움'),(_binary '\0','2023-09-10 14:44:49.000000',17,5,'가을이 오기 전에 감자를 모두 수확했습니다. 작은 감자들이 많지만 뿌듯한 하루였어요!','가을이 오기 전에 감자 캐기'),(_binary '\0','2023-10-13 11:53:04.000000',18,3,'오늘 밤 베란다에 나갔더니 허브 향이 가득하네요. 바질과 로즈마리 덕분에 집이 향기로워요.','베란다 텃밭의 향기로운 밤'),(_binary '\0','2024-07-27 11:30:22.000000',19,9,'날씨가 추워지기 전에 텃밭을 정리했어요. 내년 봄을 위해 밭을 다듬는 작업을 시작했습니다.','겨울 준비, 텃밭 정리 중'),(_binary '\0','2024-06-06 15:08:01.000000',20,5,'주말마다 텃밭에 가서 작물들을 돌보는 시간이 점점 소중해져요. 자연 속에서 힐링되는 기분입니다.','주말농장에서 느끼는 작은 행복'),(_binary '\0','2023-02-04 16:51:29.000000',21,7,'상추는 수분을 좋아하지만 과습은 피해야 해요. 흙이 마르면 물을 주고, 잎이 처지기 전에 물을 충분히 줍니다.','상추 물주기 요령'),(_binary '\0','2024-04-07 09:16:11.000000',22,1,'토마토는 햇빛을 충분히 받아야 열매가 잘 자라요. 물은 과하지 않게 주고 지지대를 세워주는 게 좋습니다.','토마토 열매 잘 키우는 법'),(_binary '\0','2023-08-04 19:51:37.000000',23,4,'고추는 진딧물이 잘 생기는데, 친환경 비누 스프레이를 이용해 해충을 관리해 주세요.','고추의 해충 방지법'),(_binary '\0','2024-07-16 15:51:23.000000',24,4,'옥수수는 심은 후에 일정 간격으로 거름을 주어야 해요. 물을 깊게 주어 뿌리가 잘 내리도록 합니다.','옥수수 건강하게 키우기'),(_binary '\0','2024-02-04 10:32:50.000000',25,11,'배추는 여름 후반이나 가을 초에 심으면 좋아요. 심은 후 물을 충분히 주고 햇빛을 많이 받게 해주세요.','배추 심는 시기와 방법'),(_binary '\0','2024-05-15 05:28:29.000000',26,4,'허브는 자주 가지치기를 해주면 더욱 풍성해져요. 윗부분을 잘라내면 옆으로 더 잘 자랍니다.','허브 가지치기 팁'),(_binary '\0','2024-05-05 02:05:56.000000',27,8,'감자는 흙이 고르게 촉촉해야 잘 자라요. 싹이 올라올 때쯤 흙을 덮어 주면 더욱 크고 건강한 감자가 됩니다.','감자 재배 시 흙 관리'),(_binary '\0','2024-07-04 16:19:33.000000',28,5,'대파는 자주 자라는 작물이에요. 자주 물을 주되, 물빠짐이 좋은 흙을 사용하는 것이 중요합니다.','대파 키우기 초보자 가이드'),(_binary '\0','2023-08-12 20:23:04.000000',29,5,'가지는 습한 환경에서 병이 잘 생기므로 물을 줄 때는 뿌리 부분만 주고 통풍이 잘 되게 해주세요.','가지의 병해 예방 방법'),(_binary '\0','2023-01-13 22:30:20.000000',30,6,'무는 뿌리 작물이므로 흙 속에 충분한 영양분이 필요해요. 비료를 잘 섞어 주고 햇빛을 충분히 받게 하세요.','무 농사 필수 비법'),(_binary '\0','2024-03-31 17:30:38.000000',31,1,'이번 주말에 드디어 베란다 텃밭을 완성했습니다. 상추와 허브를 심었는데 잘 자랄지 기대되네요!','베란다 텃밭 준비 완료!'),(_binary '\0','2024-09-13 03:32:25.000000',32,9,'고추 모종을 심으려고 하는데 간격은 얼마나 두는 게 좋을까요? 주변에 심을 작물도 추천 부탁드려요.','고추 심을 때 간격은?'),(_binary '\0','2024-01-04 19:57:49.000000',33,5,'옥수수는 옆에 다른 옥수수를 두면 수분이 잘 돼요. 배수가 잘 되는 흙을 사용하는 것도 중요합니다.','옥수수 키우기 꿀팁'),(_binary '\0','2024-03-17 21:21:54.000000',34,6,'오늘 아침에 나가보니 첫 싹이 났어요! 상추가 제일 먼저 얼굴을 내밀었네요. 기분 좋은 하루입니다.','텃밭에서 본 첫 싹!'),(_binary '\0','2024-09-12 07:22:33.000000',35,11,'베란다에서 상추를 키우는데, 잎이 자라다 멈추네요. 햇빛은 충분히 주고 있는데 뭐가 문제일까요?','상추가 잘 자라지 않아요'),(_binary '\0','2024-06-27 17:23:39.000000',36,9,'가을무를 처음 키워보는데 수확은 언제쯤 하는 게 좋을까요? 껍질이 단단해 보이면 되는 걸까요?','가을무 수확 시기'),(_binary '\0','2024-06-02 23:04:49.000000',37,6,'이번 주말 아이와 함께 주말농장에서 고구마를 수확했어요. 아이가 정말 좋아했답니다!','아이와 함께한 주말농장'),(_binary '\0','2024-05-28 05:37:47.000000',38,1,'드디어 상추와 파슬리 첫 수확을 했어요! 오늘 저녁 샐러드에 쓰려고 합니다. 너무 뿌듯하네요.','초보 텃밭러의 첫 수확'),(_binary '\0','2024-07-02 03:53:31.000000',39,2,'벌레가 자꾸 생기는데, 친환경 해충 퇴치법으로 뭐가 좋을까요? 집에서 간단히 할 수 있는 방법 찾고 있어요.','친환경 해충 퇴치법'),(_binary '\0','2024-01-11 15:33:59.000000',40,8,'로즈마리를 키우고 있는데 언제 가지치기를 해야 하는지 잘 모르겠어요. 조언 부탁드려요!','로즈마리 가지치기 시기'),(_binary '\0','2024-01-25 12:21:19.000000',41,10,'주말농장에서 소일거리하며 자연을 느끼는 시간이 요즘 가장 큰 행복이 되었어요.','주말농장에서의 힐링 타임'),(_binary '\0','2024-06-01 09:04:49.000000',42,2,'배추 잎에 누렇게 변하는 부분이 있는데 병이 생긴 걸까요? 혹시 어떻게 해야 할지 아시는 분 계신가요?','배추에 병이 생겼어요'),(_binary '\0','2023-04-13 02:42:07.000000',43,6,'봄에 상추를 언제 심는 게 좋은지 궁금해요. 너무 이른 시기에 심어도 괜찮을까요?','봄 상추 파종 시기'),(_binary '\0','2024-02-26 04:02:08.000000',44,2,'옥상 텃밭에서 하루 종일 보내다 보니 몸은 고단해도 마음은 가벼워지네요. 이것이 농사의 매력인가 봅니다.','옥상 텃밭에서의 하루'),(_binary '\0','2023-02-14 21:36:06.000000',45,12,'허브는 가지치기를 자주 해줘야 무성해져요. 상단부를 잘라주면 옆으로 더 많이 퍼지더라고요.','허브가 무성하게 자라려면?'),(_binary '\0','2024-09-14 20:26:46.000000',46,8,'고구마 심는 방법과 준비해야 할 것들이 뭐가 있을까요? 텃밭 초보라 잘 모르겠어요.','고구마 심는 방법 궁금해요'),(_binary '\0','2024-01-15 01:45:28.000000',47,4,'옥수수를 키우고 있는데 잎이 갈색으로 변해요. 물은 충분히 주고 있는데 왜 그럴까요?','옥수수 잎이 말라가요'),(_binary '\0','2024-01-06 09:11:12.000000',48,10,'감자를 수확했는데 어떻게 보관하는 게 좋을까요? 바로 먹지 않을 때 어떻게 보관해야 오래 갈까요?','감자 보관 방법'),(_binary '\0','2024-10-08 16:45:47.000000',49,5,'오늘 주말농장 친구들과 서로의 재배 노하우를 공유했어요. 많은 팁을 얻어가서 뿌듯하네요!','주말농장 친구들과 나눈 재배 노하우'),(_binary '\0','2024-08-12 16:13:31.000000',50,11,'올해는 무를 키우기로 했어요. 처음이라 잘할 수 있을지 걱정이 되지만 재미있게 해보려고 합니다!','무 농사 준비 중!');
