INSERT INTO `community_comment` VALUES ('2024-10-10 18:15:57.170436',1,1,6,'햇빛이 부족할 땐 햇빛이 잘 드는 곳으로!'),('2024-10-10 18:15:57.171436',2,1,5,'상추 맛있겠다'),('2024-10-10 18:15:57.180436',3,2,9,'쿠팡에서 재료 주문하세요'),('2024-10-10 18:15:57.180436',4,2,1,'호미 있으면 인생이 달라짐'),('2024-10-10 18:15:57.186437',5,3,4,'고구마는 보통 잎이 누렇게 변할 때쯤 수확해요!'),('2024-10-10 18:15:57.187435',6,3,8,'제 고구마는 더 일찍 수확했어요~'),('2024-10-10 18:15:57.193450',7,4,10,'햇빛이 약하면 LED 식물등을 고려해보세요.'),('2024-10-10 18:15:57.193450',8,4,7,'상추가 잘 자라길 바랍니다!'),('2024-10-10 18:15:57.198436',9,5,5,'친환경 스프레이 추천해요!'),('2024-10-10 18:15:57.199447',10,5,13,'벌레가 줄어들었으면 좋겠어요'),('2024-10-10 18:15:57.206435',11,6,7,'옥상 텃밭에는 허브도 좋아요!'),('2024-10-10 18:15:57.206435',12,6,6,'작물 심기 전에 바닥 배수 꼭 신경 쓰세요.'),('2024-10-10 18:15:57.210436',13,7,7,'배추는 병이 생기기 쉬우니 자주 확인하세요.'),('2024-10-10 18:15:57.211436',14,7,12,'김장 준비 파이팅입니다!'),('2024-10-10 18:15:57.219436',15,8,13,'감자는 시원하고 어두운 곳에 보관하세요.'),('2024-10-10 18:15:57.219436',16,8,11,'수확 축하드려요! 감자전 추천해요.'),('2024-10-10 18:15:57.225436',17,9,5,'유기농 비료도 좋아요! 자주 주지 말고 간격을 두세요.'),('2024-10-10 18:15:57.226436',18,9,5,'텃밭 화이팅입니다!'),('2024-10-10 18:15:57.231435',19,10,12,'허브는 실내에서 키울 때 가습기 틀어주면 좋아요.'),('2024-10-10 18:15:57.232435',20,10,4,'겨울에도 무럭무럭 자라길 바랍니다!'),('2024-10-10 18:15:57.237436',21,11,8,'주말농장이 생생하게 그려지네요! 다음 주말도 기대됩니다!'),('2024-10-10 18:15:57.241435',22,12,7,'허브 향 너무 좋아요! 요리에 쓸 때마다 뿌듯하시겠어요.'),('2024-10-10 18:15:57.242435',23,12,11,'바질이 진짜 잘 자라네요! 허브 키우기 정말 즐겁죠!'),('2024-10-10 18:15:57.245435',24,13,1,'토마토가 잘 자라서 다행이네요! 열매 맺힐 날이 기대됩니다.'),('2024-10-10 18:15:57.245435',25,13,3,'물 줄 때마다 쑥쑥 자라네요. 곧 빨갛게 익을 거예요!'),('2024-10-10 18:15:57.249436',26,14,5,'아침 텃밭 풍경이라니 너무 평화로워 보여요.'),('2024-10-10 18:15:57.249436',27,14,9,'상추가 싱그럽게 자라다니! 건강한 텃밭이네요.'),('2024-10-10 18:15:57.255435',28,15,9,'옥수수 이슬 맺힌 모습 상상돼요! 사진 찍으셨다니 부럽습니다.'),('2024-10-10 18:15:57.255435',29,15,12,'이슬 맺힌 모습이 예쁠 것 같아요. 멋진 사진 기대할게요!'),('2024-10-10 18:15:57.259436',30,16,7,'아이와 함께 수확이라니 정말 소중한 시간이었겠어요!'),('2024-10-10 18:15:57.260434',31,16,3,'작은 손으로 따는 모습이라니 너무 귀여워요!'),('2024-10-10 18:15:57.260434',32,16,2,'상추 수확 축하드려요! 맛있게 드세요~'),('2024-10-10 18:15:57.263435',33,17,2,'감자 수확 수고 많으셨어요! 감자 요리 추천드려요.'),('2024-10-10 18:15:57.263435',34,17,12,'가을 감자라니 정말 맛있을 것 같아요!'),('2024-10-10 18:15:57.264450',35,17,3,'작은 감자들도 알차게 수확하셨네요!'),('2024-10-10 18:15:57.268439',36,18,12,'허브 향 가득한 밤이라니 상상만으로도 힐링이네요.'),('2024-10-10 18:15:57.268439',37,18,1,'바질이랑 로즈마리 덕분에 집이 향기로우시겠어요!'),('2024-10-10 18:15:57.269438',38,18,5,'베란다가 허브 정원 같겠어요!'),('2024-10-10 18:15:57.275436',39,19,12,'겨울 준비 잘 하셨네요! 내년 봄이 벌써 기대돼요.'),('2024-10-10 18:15:57.275436',40,19,4,'텃밭을 정리하니 마음도 깔끔해지셨겠어요.'),('2024-10-10 18:15:57.276436',41,19,2,'봄을 준비하는 마음, 정말 멋집니다!'),('2024-10-10 18:15:57.282438',42,20,2,'주말농장에서 마음의 힐링, 정말 좋네요!'),('2024-10-10 18:15:57.282438',43,20,6,'작물 키우는 시간이 소중해진다니 공감됩니다!'),('2024-10-10 18:15:57.283437',44,20,13,'자연 속에서 힐링이 정말 필요해요!'),('2024-10-10 18:15:57.283437',45,20,10,'다음 주말도 텃밭에서 행복한 시간 보내세요!'),('2024-10-10 18:15:57.291436',46,21,5,'상추 물주기 팁 감사합니다! 과습이 문제군요.'),('2024-10-10 18:15:57.291436',47,21,10,'상추가 잘 자랄 수 있도록 물 잘 주겠습니다!'),('2024-10-10 18:15:57.296436',48,22,6,'토마토에 햇빛이 중요하다니, 더 잘 키우기 위해 햇빛 잘 받는 곳으로 옮길게요!'),('2024-10-10 18:15:57.296436',49,22,2,'지지대 세우는 거 잊지 말아야겠네요.'),('2024-10-10 18:15:57.299436',50,23,11,'친환경 비누 스프레이 사용해보겠습니다! 진딧물 때문에 고민했거든요.'),('2024-10-10 18:15:57.299436',51,23,7,'고추가 무사히 자라길 바랍니다!'),('2024-10-10 18:15:57.304436',52,24,3,'거름 주는 타이밍이 중요하군요! 감사해요.'),('2024-10-10 18:15:57.304436',53,24,6,'물 깊게 주는 것도 신경 써야겠어요!'),('2024-10-10 18:15:57.311436',54,25,5,'배추 심는 시기 이제 알았네요. 여름 후반에 심을게요!'),('2024-10-10 18:15:57.312436',55,25,5,'햇빛을 잘 받게 하는 거, 정말 중요해요!'),('2024-10-10 18:15:57.318435',56,26,4,'허브 가지치기 자주 해주면 더 잘 자라네요! 잊지 않고 해보겠습니다.'),('2024-10-10 18:15:57.319435',57,26,7,'풍성한 허브를 위해 꾸준히 가지치기할게요!'),('2024-10-10 18:15:57.324436',58,27,2,'감자 재배에 대해 유용한 정보 감사합니다!'),('2024-10-10 18:15:57.324436',59,27,2,'흙을 고르게 촉촉하게 유지해야겠어요.'),('2024-10-10 18:15:57.328441',60,28,4,'대파가 자주 자란다니 잘 키울 수 있을 것 같아요!'),('2024-10-10 18:15:57.328441',61,28,3,'물빠짐 좋은 흙 사용해야겠네요. 감사합니다!'),('2024-10-10 18:15:57.332436',62,29,3,'가지는 통풍이 중요하군요! 더욱 주의해야겠어요.'),('2024-10-10 18:15:57.332436',63,29,12,'뿌리 부분만 물주면 더 좋겠네요!'),('2024-10-10 18:15:57.336435',64,30,2,'무 재배에 필요한 영양분 잘 챙길게요!'),('2024-10-10 18:15:57.337436',65,30,9,'햇빛도 충분히 받게 해야겠군요. 정보 감사합니다!'),('2024-10-10 18:15:57.339436',66,31,2,'베란다에서 상추와 허브 키우는 게 너무 좋겠어요!'),('2024-10-10 18:15:57.340435',67,31,2,'저도 텃밭 만들고 싶어요. 잘 자라길 바랍니다!'),('2024-10-10 18:15:57.346437',68,32,8,'고추 간격에 대해 좋은 팁 감사해요! 고민이 많았거든요.'),('2024-10-10 18:15:57.346437',69,32,1,'주변 작물도 잘 자라도록 조언해 주시면 감사하겠습니다!'),('2024-10-10 18:15:57.350436',70,33,7,'옥수수는 배수 잘 되는 흙이 중요하다니, 다음에 참고하겠습니다!'),('2024-10-10 18:15:57.351435',71,33,2,'수분 잘 유지할 수 있도록 할게요!'),('2024-10-10 18:15:57.355434',72,34,1,'와, 첫 싹이 났다니 축하해요! 상추가 잘 자라길 바랍니다!'),('2024-10-10 18:15:57.362436',73,35,4,'상추가 잘 자라지 않는다면, 흙 상태도 체크해보세요. 영양분이 부족할 수 있어요.'),('2024-10-10 18:15:57.367435',74,36,7,'가을무 수확 시기, 보통 뿌리가 두께가 5~6cm 정도 될 때 수확하면 좋아요.'),('2024-10-10 18:15:57.369436',75,37,4,'아이와 함께한 수확이라니! 정말 좋은 추억이네요. 아이가 좋아하는 모습이 상상돼요.'),('2024-10-10 18:15:57.373436',76,38,6,'첫 수확 축하드립니다! 샐러드 맛있겠어요. 앞으로 더 많은 수확이 있길 바래요.'),('2024-10-10 18:15:57.378438',77,39,9,'친환경 방법으로는 물과 식초를 섞어 뿌리면 효과적이에요. 한번 시도해보세요!'),('2024-10-10 18:15:57.381436',78,40,6,'로즈마리는 성장기에 가지치기 해주면 더욱 풍성해져요. 봄에 해보세요.'),('2024-10-10 18:15:57.386435',79,41,8,'자연 속에서의 시간, 정말 소중하죠! 저도 힐링되는 기분이에요.'),('2024-10-10 18:15:57.389436',80,42,3,'배추에 병이 생긴 것 같다면, 빠르게 치료해주는 것이 중요해요. 방제를 고려해보세요.'),('2024-10-10 18:15:57.394437',81,43,9,'봄에 상추는 3월 초에 심는 것이 좋아요. 너무 이르지 않게 심어보세요.'),('2024-10-10 18:15:57.396436',82,44,6,'옥상에서의 농사, 정말 매력적이죠! 고단해도 보람이 있겠어요.'),('2024-10-10 18:15:57.400438',83,45,3,'허브가 무성하게 자라려면 자주 가지치기해주면 좋아요. 잘 해보세요!'),('2024-10-10 18:15:57.404436',84,46,5,'고구마 심는 법은 깊이 10cm 정도로 심고, 충분한 간격을 두는 것이 중요해요.'),('2024-10-10 18:15:57.408436',85,47,4,'옥수수 잎이 마르는 건 수분 부족이나 영양 부족일 수 있어요. 체크해보세요!'),('2024-10-10 18:15:57.411439',86,48,6,'감자는 통풍이 잘되는 곳에 보관해야 해요. 신문지에 싸서 보관하는 것도 좋아요.'),('2024-10-10 18:15:57.414436',87,49,5,'서로의 노하우를 공유하는 건 정말 좋은 경험이네요! 계속해서 배우세요.'),('2024-10-10 18:15:57.417435',88,50,10,'무 농사는 처음이라면 조금씩 배워가며 하세요! 재미있게 해보세요!');
/*!40000 ALTER TABLE `community_comment` ENABLE KEYS */;
